pragma solidity >=0.5.0;

contract Photo {
  struct Listing {
    // general structure of things for a photo listing
    string name;
    string description;
    string actualName;
    string price;
  }
  mapping (uint => Listing) public listings;
  uint public listingCount;
  constructor () public { // let's start out with adding the photos
    // picture 1
    string memory title = "Springtime in February";
    string memory description = "Taken at Georgia State University in February of 2017.";
    string memory actualName = "32716194821_5115481715";
    string memory price = '1';
    addPhoto (title, description, actualName, price);
    // picture 2
    title = "Through Concrete";
    description = "Taken at Georgia State University in February of 2017.";
    actualName = "32025085133_1c27a7f4e0";
    price = '1';
    addPhoto (title, description, actualName, price);
    // picture 3
    title = "Cherry Blossoms";
    description = "Taken at Georgia State University in February of 2017.";
    actualName = "32077057834_629722e347";
    price = '1';
    addPhoto (title, description, actualName, price);
  }
  function addPhoto (string memory title, string memory description, string memory actualName, string memory price) private { // visibility should be private since it won't be used outside this contract
    listingCount++;
    listings[listingCount] = Listing (title, description, actualName, price);
  }
}
